import styled from 'styled-components';


export const FooterStyled = styled.div`
    width: 100%;
    max-width: 80%;
    padding: 100px 5px;
    margin: auto;
    align-content: center;
    position: relative;
    margin-right: 30px;
    margin-bottom: -500px;
    background-color:Black;
    z-index:100;
    font-size: 25px;
    color: White;
`
